import React from 'react';
import { MdAdd } from 'react-icons/md';
import './TodoInsert.scss';

const TodoInsert = () => {
    return (
        <form className="TodoInsert">
            <input placeholder="할 일을 적으세요" />
            <button type="submit"><MdAdd /></button>
        </form>
    );
};

export default TodoInsert;
